import {Tableau} from '/tableau.js';

'use strict';
// generate the stabilizer and destabilizer for |0..0>
const gen_identity = function (n) {
    let gens = new Array(2*n);

    for (let i = 0; i < n; i++) {
        let gsx = new Array(n+1);
        let gsz = new Array(n+1);
        for (let j = 0; j < n; j++) {
            gsx[j] = 'I';
            gsz[j] = 'I';
        }
        gsx[n] = '+';
        gsz[n] = '+';
        gsx[i] = 'X';
        gsz[i] = 'Z';

        gens[i]   = gsx;
        gens[i+n] = gsz;
    }

    return gens;
}

// deep copy the array of generators
const gen_copy = function(gens) {
    const len    = gens.length/2;
    let gens_cpy = new Array(len);

    for(let i = 0; i < len; i++) {
        gens_cpy[i] = [].concat(gens[i]);
    }

    return gens_cpy;
}

// return an array of generators as strings (by joining)
const gen_str = function(gens) {
    const N      = gens.length;
    const n      = gens.length/2;

    let gens_cpy = gen_copy(gens);

    for (let i = 0; i < N; i++) {
        gens_cpy[i] = gens[i][n] + gens[i].slice(0, -1).join('');
    }

    return gens_cpy;
}

// return generator for state achieved by applying hadamard to
// specified qubits from |0...0> state
const gen_hadamard = function (n, qubits) {
    let gens = gen_identity(n);

    for (let i of qubits) {
        gens[i][i] = 'Z';
        gens[i+n][i] = 'X';
    }

    return gens;
}

// return generators for state achieved by applying cnot to
// specified qubits from |0...0> state
const gen_cnot = function (n, controls, targets) {
    let gens = gen_identity(n);
    if (controls.length !== targets.length) {
        throw new Error("different number of controls and target qubits");
        return;
    }

    const N = controls.length;
    for (let i = 0; i < N; i++) {
        const c = controls[i];
        const t = targets[i];
        gens[c][t] = 'X';
        gens[t+n][c] = 'Z';
    }

    return gens;
}


const {test} = QUnit;

QUnit.module("Tableau operations");

test("hadamard, n = 2", assert => {
    const n = 2;
    let tab = new Tableau(n);
    tab.initialize();
    tab.h(0);
    assert.deepEqual(tab.generators(), gen_str(gen_hadamard(n, [0])) );

    tab.initialize();
    tab.h(1);
    assert.deepEqual(tab.generators(), gen_str(gen_hadamard(n, [1])) );

    tab.initialize();
    tab.h(0);
    tab.h(1);
    assert.deepEqual(tab.generators(), gen_str(gen_hadamard(n, [0, 1])) );
});

test("hadamard, n = 32", assert => {
    const n = 32;
    let tab = new Tableau(n);
    let qubits = [0];
    tab.initialize();

    for (let q of qubits)
        tab.h(q);
    console.log(tab.generators()[32]);

    assert.deepEqual(tab.generators(), gen_str(gen_hadamard(n, qubits)) );
});

test("hadamard, n = 40", assert => {
    const n = 40;
    let tab = new Tableau(n);
    let qubits = [0, 10, 5, 11, 22, 39, 28];
    tab.initialize();

    for (let q of qubits)
        tab.h(q);

    assert.deepEqual(tab.generators(), gen_str(gen_hadamard(n, qubits)) );
});



test("cnot, n = 2", assert => {
    const n = 2;
    let tab = new Tableau(n);

    const apply = function(c, t) {
        for (let i = 0; i < c.length; i++)
            tab.cnot(c[i], t[i]);
    };

    tab.initialize();

    apply([0], [1]);
    assert.deepEqual(tab.generators(), gen_str(gen_cnot(n, [0], [1])) );

    apply([0], [1]);
    assert.deepEqual(tab.generators(), gen_str(gen_identity(n)) );

    apply([1], [0]);
    assert.deepEqual(tab.generators(), gen_str(gen_cnot(n, [1], [0])) );

    apply([1], [0]);
    assert.deepEqual(tab.generators(), gen_str(gen_identity(n)) );
});


test("cnot, n = 32", assert => {
    const n = 32;
    let tab = new Tableau(n);

    const apply = function(c, t) {
        for (let i = 0; i < c.length; i++)
            tab.cnot(c[i], t[i]);
    };

    tab.initialize();

    apply([0, 10, 20], [1, 12, 31]);
    assert.deepEqual(tab.generators(), gen_str(gen_cnot(n, [0, 10, 20], [1, 12, 31])) );

    apply([0, 10, 20], [1, 12, 31]);
    assert.deepEqual(tab.generators(), gen_str(gen_identity(n)) );
});



test("phase/hadamard, n = 2", assert => {
    const n = 2;
    const res_hp0 =[
        // p 0
        ["+ZI", "+IX", "+YI", "+IZ"],
        // p 0
        ["+ZI", "+IX", "-XI", "+IZ"],
        // p 0
        ["+ZI", "+IX", "-YI", "+IZ"],
        // p 0
        ["+ZI", "+IX", "+XI", "+IZ"],
    ];

    let tab = new Tableau(n);
    tab.initialize();

    tab.h(0)
    tab.p(0);
    assert.deepEqual(tab.generators(), res_hp0[0]);

    tab.p(0);
    assert.deepEqual(tab.generators(), res_hp0[1]);

    tab.p(0);
    assert.deepEqual(tab.generators(), res_hp0[2]);

    tab.p(0);
    assert.deepEqual(tab.generators(), res_hp0[3]);


    const res_hp01 =[
        // p 0
        ["+ZI", "+IZ", "+YI", "+IX"],
        // p 1
        ["+ZI", "+IZ", "+YI", "+IY"],
        // p 1
        ["+ZI", "+IZ", "+YI", "-IX"],
        // p 0
        ["+ZI", "+IZ", "-XI", "-IX"],
        // h 0
        ["+XI", "+IZ", "-ZI", "-IX"],
        // h 1
        ["+XI", "+IX", "-ZI", "-IZ"],
    ];

    tab.initialize();
    tab.h(0);
    tab.h(1);

    tab.p(0);
    assert.deepEqual(tab.generators(), res_hp01[0]);

    tab.p(1);
    assert.deepEqual(tab.generators(), res_hp01[1]);

    tab.p(1);
    assert.deepEqual(tab.generators(), res_hp01[2]);

    tab.p(0);
    assert.deepEqual(tab.generators(), res_hp01[3]);

    tab.h(0);
    assert.deepEqual(tab.generators(), res_hp01[4]);

    tab.h(1);
    assert.deepEqual(tab.generators(), res_hp01[5]);
});



test("cnot/hadamard, n = 2", assert => {
    const n = 2;
    const res =[
        // h 0
        // cnot 0, 1
        ["+ZI", "+IX", "+XX", "+ZZ"],
        // h 1
        ["+ZI", "+IZ", "+XZ", "+ZX"],
        // cnot 1, 0
        ["+ZZ", "+IZ", "+XZ", "-YY"],
        // cnot 0, 1
        ["+IZ", "+ZZ", "-YY", "+XZ"],
        // h 0
        ["+IZ", "+XZ", "+YY", "+ZZ"],
        // h 1
        ["+IX", "+XX", "-YY", "+ZX"],
    ];

    let tab = new Tableau(n);
    tab.initialize();

    tab.h(0);
    tab.cnot(0, 1);
    assert.deepEqual(tab.generators(), res[0]);

    tab.h(1);
    assert.deepEqual(tab.generators(), res[1]);

    tab.cnot(1, 0);
    assert.deepEqual(tab.generators(), res[2]);

    tab.cnot(0, 1);
    assert.deepEqual(tab.generators(), res[3]);

    tab.h(0);
    assert.deepEqual(tab.generators(), res[4]);

    tab.h(1);
    assert.deepEqual(tab.generators(), res[5]);
});

