test("cnot/phase/hadamard/measure probabilistic, n = 2", assert => {
    const n = 2;
    const res =[
        // h 0
        ["+ZI", "+IX", "+XI", "+IZ"],
        // h 1
        ["+ZI", "+IZ", "+XI", "+IX"],
        // m 0; (probabilistic)
        [],
        // m 1; (probabilistic)
        [],
    ];

    const m_res = [
        [
            // m 0 -> 0, m 1 -> 0
            [["+XI", "+IZ", "+ZI", "+IX"], ["+XI", "+IX", "+ZI", "+IZ"]],
            // m 0 -> 0, m 1 -> 1
            [["+XI", "+IZ", "+ZI", "+IX"], ["+XI", "+IX", "+ZI", "-IZ"]]
        ],
        [
            // m 0 -> 1, m 1 -> 0
            [["+XI", "+IZ", "-ZI", "+IX"], ["+XI", "+IX", "-ZI", "+IZ"]],
            // m 0 -> 1, m 1 -> 1
            [["+XI", "+IZ", "-ZI", "+IX"], ["+XI", "+IX", "-ZI", "-IZ"]]
        ]
    ]


    let tab = new Tableau(n);
    tab.initialize();

    const instrs = [
        {f: tab.h,       args: [0]},
        {f: tab.h,       args: [1]},
        {f: tab.measure, args: [0]},
        {f: tab.measure, args: [1]},
    ];

    if (res.length !== instrs.length)
        throw new Error("results and instructions array length mismatch");

    let record = [];
    for (let i = 0; i < res.length; i++) {
        let r = instrs[i].f.apply(tab, instrs[i].args);
        if (instrs[i].f === tab.measure) {
            assert.notStrictEqual(r, undefined);
            record.push({value: r, gen: tab.generators()});
        } else {
            assert.deepEqual(tab.generators(), res[i]);
        }
    }

    assert.deepEqual(record[0].gen, m_res[record[0].value][record[1].value][0]);
    assert.deepEqual(record[1].gen, m_res[record[0].value][record[1].value][1]);
});

test("cnot/phase/hadamard/measure deterministic, n = 2", assert => {
    const n = 2;
    const res =[
        // h 0
        ["+ZI", "+IX", "+XI", "+IZ"],
        // p 0
        ["+ZI", "+IX", "+YI", "+IZ"],
        // h 1
        ["+ZI", "+IZ", "+YI", "+IX"],
        // p 1
        ["+ZI", "+IZ", "+YI", "+IY"],
        // p 0
        ["+ZI", "+IZ", "-XI", "+IY"],
        // p 1
        ["+ZI", "+IZ", "-XI", "-IX"],
        // h 1
        ["+ZI", "+IX", "-XI", "-IZ"],
        // h 0
        ["+XI", "+IX", "-ZI", "-IZ"],
        // m 0; 1 (deterministic)
        ["+XI", "+IX", "-ZI", "-IZ"],
        // m 1; 1 (deterministic)
        ["+XI", "+IX", "-ZI", "-IZ"],
    ];


    let tab = new Tableau(n);
    tab.initialize();

    const instrs = [
        {f: tab.h,       args: [0]},
        {f: tab.p,       args: [0]},
        {f: tab.h,       args: [1]},
        {f: tab.p,       args: [1]},
        {f: tab.p,       args: [0]},
        {f: tab.p,       args: [1]},
        {f: tab.h,       args: [1]},
        {f: tab.h,       args: [0]},
        {f: tab.measure, args: [0]},
        {f: tab.measure, args: [1]},
    ];

    if (res.length !== instrs.length)
        throw new Error("results and instructions array length mismatch");

    for (let i = 0; i < res.length; i++) {
        let r = instrs[i].f.apply(tab, instrs[i].args);
        if (instrs[i].f === tab.measure) {
            assert.equal(r, 1);
        } 

        assert.deepEqual(tab.generators(), res[i]);
    }
});
